import React from "react";
import SearchBooks from "./pages/SearchBooks";
import SavedBooks from "./pages/SavedBooks";
import Nav from "./components/Nav";
import './App.css';


function App() {
  return (
    <div>
      <Nav />
      <SearchBooks/>
      <SavedBooks />
    </div>
  );
}


export default App;
